import Head from 'next/head'
import Nav from './Nav'
import Footer from './Footer'

export default ({ children, title = 'This is the default title' }) => (
    <div>
        <Head>
            <meta charSet="utf-8"/>
            <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"/>
            <meta name="description" content="not now"/>
            <meta name="author" content="john doe"/>
            <meta name="generator" content="test"/>

            <title>{title}</title>
        </Head>

        <header>
            <Nav />
        </header>

        <main className="animated fadeIn delay-03s">
            <style jsx global>{`
                body {
                    font-family: 'SF Pro Text', 'SF Pro Icons', 'Helvetica Neue', 'Helvetica',
                    'Arial', sans-serif;
                    padding: 50px 0px 0px 0px;
                    /*max-width: 680px;*/
                    margin: 0 auto;
                    background: #FFFFFF; 
                } 
                @media (max-width: 575.98px) {
                 h2 {
                   font-size: 3rem !important;
                 }
                }
                @media (min-width: 576px) and (max-width: 767.98px) {
                 h2 {
                   font-size: 3rem !important;
                 }
                }
                @media (min-width: 768px) and (max-width: 991.98px) {
                 h2 {
                   font-size: 4rem !important;
                 }
                }
                @media (min-width: 992px) and (max-width: 1199.98px) {
                 h2 {
                   font-size: 4rem !important;
                 }
                }
                @media (min-width: 1200px) {
                 h2 {
                   font-size: 4rem !important;
                 }
                }
                footer{
                    background: #343a40 !important;
                    color: #adb5bd;
                }
                footer h3{
                    color:#868e96
                } 
                .bottom-container{
                    background: #212529;
                }
                @media (min-width: 544px) {  
                    .class-name {font-size: 16px;}
                }
                
                   @media (min-width: 768px) {  
                    .class-name {font-size: 30px;}
                  }
                
                   @media (min-width: 992px) { 
                    .class-name {font-size: 40px;}
                
                   @media (min-width: 1200px) {  
                    .class-name {font-size: 48px;}
                  }
            `}</style>
            { children }
        </main>

        <Footer className="animated fadeIn delay-03s">
            Footer
        </Footer>

    </div>
)
